import React, { useState, useEffect } from "react"
import { useNavigate } from "react-router-dom";

const DetalleSucursal = (props) => {
    const navigate = useNavigate();
    const [Sucursal, setSucursal] = useState({
        ID_Sucursal: 0,
        Nombre_Sucursal: '',
        Telefono: 0,
        Descripcion: '',
        Estado: true
    })

    const CambioValor = (e) => {
        const { name, value } = e.target
        setSucursal({ ...Sucursal, [name]: value })
    }

    const ClickBtnGuardar = () => {

    }

    const cargandoFormulario = async () => {
        if (props.IdPasajeroActual > 0) {
            let URL = `http://localhost:${props.ApiPort}//api/ApiPasajeros/ConsultarPasajeroxID?ID_Pasajero=${props.IdPasajeroActual}`
            let Pasajeros = await fetch(URL).then(async response => {
                if (!response.ok) {
                    console.log("No Ok")
                    throw new Error(response.statusText)
                }
                return await response.json()
            }).catch(error => {
                console.log(error)
            })
            if (Pasajeros.Codigo >= 0) {
                setPasajero(Pasajeros.Contenido[0])
            }
            else {
                console.log(Pasajeros.Mensaje)
            }
        }
    }
}
export default DetalleSucursal;
